const LogReg = () => {
	let [logreg,setLogreg]=useState(0)
	let func = ()=>{
		setLogreg(1)
	}
	return (
		<div className={logreg===0?"login-reg-cont":"login-reg-cont-active"} >
			<Log func={func} />
			<Reg/>

		</div>
	)
}
const Log = (props) => {
	console.log(props.func)
